/* harmony default export */ __webpack_exports__["default"] = ("<style>.internal-header .toolbar-container{padding-top:15px !important;padding-bottom:15px !important}</style>\n<!-- Back button with a default href -->\n<ion-header  class=\"internal-header ion-align-items-center\">\n  <ion-toolbar>\n    <ion-buttons slot=\"start\">\n      <ion-back-button defaultHref=\"/home\"></ion-back-button>\n\t  \n    </ion-buttons>\n\t    <ion-title><img class=\"logo\" src=\"../assets/images/logo.svg\"></ion-title>\n\t\t  <ion-buttons slot=\"end\">\n      <ion-menu-button></ion-menu-button>\n    </ion-buttons>\n  </ion-toolbar>\n</ion-header>\n<ion-content [fullscreen]=\"true\">\n    \n\n<section  class=\"text-center internal-hero ion-align-items-center\" style='background:url(../assets/images/about-us-banner.jpg)'>\n    <h3 class=\"span-underline internal-hero-title\"><span>About us </span></h3>\n  </section>\n  \n  \n<div class=\"px-1 \">\t\t  \n<h5>Mission / Vision</h5>\n\n<p class=\"mt-0\">At discipleFIRST we help leaders develop a disciple-making culture in their ministry. We serve as a resource for pastors to encourage, equip and champion disciple making in the local church following the model of Jesus Christ.</p>\n<h5>Who We Are</h5>\n\n<p class=\"mt-0\">While many define “discipleship” in terms of general spiritual growth, we believe “disciple making” is an intentional process that produces a 3D disciple, beginning with evangelism and resulting in spiritual multiplication. We define a 3D disciple as someone who is DEVOTED to Jesus, is DEVELOPING the character and competencies of Jesus and is DEPLOYED into the ministry of Jesus by making disciples who make disciples. Success for us is moving people through this process and fulfilling the Great Commission.</p>\n<h5>Essentials We Believe</h5>\n\n<h6>About the Bible</h6>\n<p class=\"mt-0\">The Bible is God’s Word to man. The Bible is God’s inerrant Word to us, as originally given by God through human authors under the supernatural guide of the Holy Spirit, and is absolutely true and trustworthy. It is our only standard of faith and practice.<br>\n<strong>(II Timothy 3:16-17, Hebrews 4:12; II Peter 1:20-21; Matthew 5:18; Psalm 119)</strong></p>\n<h6>About God</h6>\n<p class=\"mt-0\">There is only one true and living God. God is the Creator and Sustainer of all things. He is infinite, eternal, unchangeable, and is revealed to us as the Godhead existent in the co-equal, co-eternal, and co-substantial persons: the Father, the Son, and the Holy Spirit.<br>\n<strong>(Ephesians 1:3-6, 13-14; Ephesians 4:6; Matthew 28:19; Genesis 1:1,3,14,18; Isaiah 9:6)</strong></p>\n<h6>The Father</h6>\n<p class=\"mt-0\">The Father is the first person of the Trinity who orders and disposes of all things according to His own purpose and grace,<br>\nand who continually upholds, directs, and governs all creatures and events for His own glory. Fatherhood denotes spiritual relationship; first within the Trinity; second, within mankind, creatively in relation to all men, but spiritually only in relation to those who have been saved by His grace for their sin and come to Him through Jesus Christ.<br>\n<strong>(James 1:17)</strong></p>\n<h6>The Son</h6>\n<p class=\"mt-0\">Jesus Christ is the promised Messiah of the Old Testament, born of a virgin, lived a sinless life, offered Himself as the perfect sacrifice for the sin of all people by dying on the cross, rose from the dead to provide justification for every believer, ascended to the right hand of God where He presently intercedes for all believers, and will again, in the fullness of the Father’s time, return in visible, triumphant, personal form to overthrow sin, judge the world, and establish His kingdom on earth.<br>\n<strong>(John 1:14)</strong></p>\n<h6>The Spirit</h6>\n<p class=\"mt-0\">The Holy Spirit is sent from God to convict the world of sin, unrighteousness, and judgment, and to regenerate, cleanse, and secure from sin. He lives in every Christian from the moment of salvation. He provides the Christian with power for living, understanding of spiritual truth, and guidance in doing what is right. He gives every believer a spiritual gift when they are saved. As Christians, we seek to live under His control daily.<br>\n<strong>(John 14:16-18; John 16:8, 13)</strong></p>\n<h6>About Man, Sin, and Satan</h6>\n<p class=\"mt-0\">Man’s condition is one of sin and separation from God. Man was created by innocence, directly and immediately by God in His spiritual image, for the purpose of fellowship with God and glory for God. Man was tempted by Satan and sinned, and because of this, all men have been born in sin since that time. Every person has a tremendous potential for good, but all are marred by a nature of rebellion and disobedience toward God, others, and all good things, ultimately and eternally bound for hell. All persons need to be saved from their sin.</p>\n<h6>About Salvation</h6>\n<p class=\"mt-0\">God has acted in Jesus Christ to deliver us from sin. Jesus Christ is the only Savior from sin. He provided forgiveness and atonement for our sins by shedding his blood on the cross and rose again to provide life and justification. Apart from Christ, there is no salvation. All men are under condemnation through personal sin, and deliverance from personal sin comes only through righteousness of Christ and not human merit. This righteousness is credited to the believer by grace through faith. The Holy Spirit regenerates or gives new life to one who commits his life to Jesus, and he is kept by God’s power forever, never to be lost.</p>\n<h6>About the Church</h6>\n<p class=\"mt-0\">Jesus established the church to continue His mission and ministry on earth. A New Testament church is a voluntary association of baptized believers in Christ who have covenanted together to follow the teachings of the New Testament in doctrine, worship, and practice.</p>\n<h6>About Last Things</h6>\n<p class=\"mt-0\">Jesus Christ will return, and God’s plan for eternity will be carried out. We believe in the imminent and bodily return of Jesus Christ to the earth. The dead will be raised, and Christ will judge all men according to their works. Unbelievers will be cast into eternal punishment and outer darkness prepared for the devil and his angels who preceded them, and the saved will enter into the eternal state of glory with God and will in their resurrected and glorified bodies spend eternity.</p>\n<h6>Death and Resurrection</h6>\n<p class=\"mt-0\">Everyone will face judgment before God; some to eternal life, others to eternal condemnation. Death involves no loss of consciousness, but the soul of the redeemed passes immediately into the presence of Christ, and there is separation of soul and body until the first resurrection when the spirit, soul and resurrected body will be reunited in glorified form in heaven forever. All men will be bodily resurrected, the saved to everlasting life, but the lost into eternal condemnation.</p>\n </div>                       \n</ion-content>\n");

